# PMC TUI v3 Installer - 2026-01-22
$b = ""
$z = Join-Path $PSScriptRoot "pmc.zip"
$d = Join-Path $PSScriptRoot "PMC"
Write-Host "PMC TUI v3 Installer" -ForegroundColor Cyan
[System.IO.File]::WriteAllBytes($z, [Convert]::FromBase64String($b))
if (Test-Path $d) {
    $bak = "$d.bak.$(Get-Date -Format 'yyyyMMddHHmmss')"
    Rename-Item $d $bak
    Write-Host "Backed up to: $bak"
}
Expand-Archive $z $d -Force
Remove-Item $z
Write-Host "Installed to: $d" -ForegroundColor Green
Write-Host "Run: cd $d; pwsh ./start-v3.ps1"
